import React from "react";
import { Router } from "react-router-dom";
import "./App.css";
import Authenticated from "./authenticated";
import Unauthenticated from "./unauthenticated";

function App() {
  return (
    <Router>
      <div>
        <Unauthenticated />
        <Authenticated />
      </div>
    </Router>
  );
}

export default App;
